import {
  useState,
  useEffect
} from 'react';
import {
  Typography,
  TextField,
  MenuItem,
  Button,
  Paper,
  Alert
} from '@mui/material';
import axios from '../../api/axios';

export default function CreateOrder() {
  const [stocks, setStocks] = useState([]);
  const [selectedStock, setSelectedStock] = useState('');
  const [orderType, setOrderType] = useState('buy');
  const [orderPrice, setOrderPrice] = useState('');
  const [quantity, setQuantity] = useState('');
  const [success, setSuccess] = useState('');
  const [error, setError] = useState('');

  useEffect(() => {
    fetchStocks();
  }, []);

  const fetchStocks = async () => {
    try {
      const res = await axios.get('/stocks');
      setStocks(res.data);
      if (res.data.length > 0) {
        setSelectedStock(res.data[0].symbol); // ✅ Auto-select first stock by symbol
      }
    } catch (err) {
      console.error(err);
      setError('Failed to fetch stocks.');
    }
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setSuccess('');

    const parsedPrice = parseFloat(orderPrice);
    const parsedQuantity = parseInt(quantity);

    if (!selectedStock || isNaN(parsedPrice) || isNaN(parsedQuantity)) {
      setError('Please fill all fields correctly.');
      return;
    }

    const selectedStockObj = stocks.find(s => s.symbol === selectedStock);
    if (!selectedStockObj) {
      setError('Selected stock not found.');
      return;
    }

    try {
      const token = localStorage.getItem('token');
      await axios.post('/orders', {
        stock_id: selectedStockObj.id, // ✅ Use correct ID
        order_type: orderType,
        order_price: parsedPrice,
        quantity: parsedQuantity,
        status: 'pending'
      }, {
        headers: { Authorization: `Bearer ${token}` }
      });

      setSuccess('Order placed successfully!');
      setOrderPrice('');
      setQuantity('');
    } catch (err) {
      console.error(err);
      setError('Failed to place order.');
    }
  };
  const open = parseFloat(stocks.open_price) || 0;
  const close = parseFloat(stock.close_price) || 0;
  const change = close - open;
  const changePercent = open ? ((change / open) * 100).toFixed(2) : 0;
  return (
    <Paper sx={{ p: 3, mt: 4 }}>
      <Typography variant="h6" gutterBottom>Create Order</Typography>

      {error && <Alert severity="error" sx={{ mb: 2 }}>{error}</Alert>}
      {success && <Alert severity="success" sx={{ mb: 2 }}>{success}</Alert>}

      <form onSubmit={handleSubmit}>
        <TextField
          fullWidth
          select
          label="Select Stock"
          value={selectedStock || ''}
          onChange={e => setSelectedStock(e.target.value)}
          margin="normal"
          required
        >
          {stocks.map(stock => (
            <MenuItem key={stock.symbol} value={stock.symbol}>
              {stock.symbol}
            </MenuItem>
          ))}
        </TextField>

        <TextField
          fullWidth
          select
          label="Order Type"
          value={orderType}
          onChange={e => setOrderType(e.target.value)}
          margin="normal"
          required
        >
          <MenuItem value="buy">Buy</MenuItem>
          <MenuItem value="sell">Sell</MenuItem>
        </TextField>

        <TextField
          fullWidth
          label="Order Price"
          type="number"
          value={orderPrice}
          onChange={e => setOrderPrice(e.target.value)}
          margin="normal"
          required
        />

        <TextField
          fullWidth
          label="Quantity"
          type="number"
          value={quantity}
          onChange={e => setQuantity(e.target.value)}
          margin="normal"
          required
        />

        <Button
          type="submit"
          variant="contained"
          color="primary"
          sx={{ mt: 2 }}
        >
          Place Order
        </Button>
      </form>
    </Paper>
  );
}
